import React from 'react';
import Cell from './Cell';

const Board = () => {
    return (
        <div>
            <div className="game-board">
                <Cell></Cell>
                <Cell></Cell>
                <Cell></Cell>
                <Cell></Cell>

            </div>
        </div>
    );
};

export default Board;
